import React, { useState } from "react";
import "./Faqs.css";
import { questios } from "../question";

const Faqs = () => {
    let [currentId, setCurrentId] = useState(questios[0].id)
    let items = questios.map((itemsData, i) => {

        let itemsDetails = {
            itemsData,
            currentId,
            setCurrentId
        }
        return (
            <FaqItems key={i} itemsDetails={itemsDetails}/>
        )
    })
  return (
    <>
      <h1>Frequently Asked Questions (FAQs)</h1>
      <div className="faqouter">
       {items}
      </div>
    </>
  );
};

export default Faqs;

function FaqItems({itemsDetails}) {
  return (
    <div className="faqItems">
      <h2>{itemsDetails.itemsData.questios}</h2>
      <p>Ws</p>
    </div>
  );
}
